import React from 'react'
import { IoMdContrast } from 'react-icons/io'
import { Divider } from 'antd'

interface IHeaderProps {
  children?: React.ReactNode
  title?: string,
  accessibility?: boolean,
  onClickAccessibility?(itemName: string): void,
  height?: number | string
}

const styleItems: React.CSSProperties = {
  cursor: 'pointer'
}

function Header(props: IHeaderProps): JSX.Element {

  return (
    <header className="cegov-container-header" style={{ height: props.height }} >
      {
        props.accessibility &&
        (
          <div className="cegov-accessibility">
            <div className="cegov-accessibility-left">
              <span>Acessibilidade</span>
              <div
                style={styleItems}
                onClick={() => props.onClickAccessibility ? props.onClickAccessibility('A-') : false}
              >
                <IoMdContrast />
              </div>&emsp;
              <div
                style={styleItems}
                onClick={() => props.onClickAccessibility ? props.onClickAccessibility('A-') : false}
              >
                A-
              </div>&emsp;
              <div
                style={styleItems}
                onClick={() => props.onClickAccessibility ? props.onClickAccessibility('A') : false}
              >
                A
              </div>&emsp;
              <div
                style={styleItems}
                onClick={() => props.onClickAccessibility ? props.onClickAccessibility('A+') : false}
              >
                A+
              </div>&emsp;&emsp;
            </div>
            <div className="cegov-accessibility-right">
              <span>
                <a href="https://www.ceara.gov.br/" target="_blank">Portal do Governo</a>
              </span>
              <Divider type="vertical" style={{ width: '5px', fontWeight: 'bold' }} />
              <span>
                <a href="https://cearatransparente.ce.gov.br" target="_blank" >Ceará Transparente</a>
              </span>
              <Divider type="vertical" />
              <span>
                <a href="https://cearatransparente.ce.gov.br/portal-da-transparencia/ouvidoria?locale=pt-BR" target="_blank">Ouvidoria</a>
              </span>
            </div>
          </div>)
      }
      {
        props.children
      }
    </header >
  )
}

export default Header

import React from 'react'
import { IoIosCheckmarkCircleOutline } from 'react-icons/io'
import { VscError } from 'react-icons/vsc'
import { IoIosSearch } from 'react-icons/io'
import { tuple } from '../../utils/type'

const type = tuple("email", "password", "text")
const inputMode = tuple("decimal", "email", "none", "numeric", "search", "tel", "text", "url")

type TInputMode = typeof inputMode[number]
type TType = typeof type[number]

interface IProps {
  style?: React.CSSProperties
  search?: boolean
  valid?: boolean
  invalid?: boolean
  value?: string | number | readonly string[]
  placeholder?: string
  className?: string
  alt?: string
  type?: TType
  maxLength?: number
  minLength?: number
  defaultValue?: string | number | readonly string[] | undefined
  autoFocus?: boolean
  inputMode?: TInputMode
  onChange?(event: React.ChangeEvent<HTMLInputElement>): void
}

const iconsStyles: React.CSSProperties = { width: '10%', height: '55%' }

function Input(props: IProps): JSX.Element {

  const invalid = props.invalid ? 'cegov-input-invalid' : ''
  const valid = props.valid ? 'cegov-input-valid' : ''
  const className = props.className

  return (
    <div
      style={props.style}
      className={`cegov-container-input ${className} ${valid} ${invalid}`}
    >
      {props.search && <IoIosSearch style={{ ...iconsStyles, color: '#B3B3B3' }} />}
      <input
        type={props.type}
        className={`cegov-input`}
        onChange={props.onChange}
        autoFocus={props.autoFocus}
        alt={props.alt}
        placeholder={props.placeholder}
        defaultValue={props.defaultValue}
        inputMode={props.inputMode}
        value={props.value}
        maxLength={props.maxLength}
        minLength={props.minLength}
      />
      {
        (props.invalid && <VscError color="red" style={{ ...iconsStyles, color: 'red' }} />)
      }
      {
        (props.valid && <IoIosCheckmarkCircleOutline style={{ ...iconsStyles, color: '#52DF9A' }} />)
      }
    </div>
  )
}

export default Input

